import React from 'react'
import ReactDOM from 'react-dom'

const Note = ({ note }) => {
  return (
    <li>{"abc"}</li>
  )
}

const Course = (props) => {
  console.log({props})
  const rows = () => props.course.parts.map(parts => 
    <Note 
      key={parts.id}
      note={"abc"}
    />
  )
  return(
  <div>
    <h1>{props.course.name}</h1>
    <ul>
        {rows()}
    </ul>

  </div>
  )
}

const App = () => {
  const course = {
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        exercises: 10,
        id: 1
      },
      {
        name: 'Using props to pass data',
        exercises: 7,
        id: 2
      },
      {
        name: 'State of a component',
        exercises: 14,
        id: 3
      }
    ]
  }

  return (
    <div>
      <Course course={course} />
    </div>
  )
}

ReactDOM.render(
  <App />, document.getElementById('root')
)
